n, m = map(int, input().split())
s = input()
dp = [[0 for i in range(m)] for j in range(n)]
for i in range(n):
    for j in range(m):
        if s[i] == s[j]:
            dp[i][j] = 1
for i in range(1, n):
    for j in range(1, m):
        if s[i] == s[j]:
            dp[i][j] = dp[i-1][j-1] + 1
ans = 0
for i in range(n):
    for j in range(m):
        if dp[i][j] == n - 1:
            ans += 1
print(ans)

