T = int(input())
for i in range(T):
    N, K = map(int, input().split())
    arr = list(map(int, input().split()))
    arr.sort()
    count = 1
    for i in range(1, N):
        if arr[i] == arr[i-1]:
            count += 1
        else:
            if count > K:
                print(arr[i-1], end=" ")
            count = 1
    if count > K:
        print(arr[N-1])
    else:
        print()
